        function removeEqualArea(){
            var unique = {};
            $scope.checkAreas.forEach(function(gpa){ unique[ JSON.stringify(gpa) ] = gpa });
            $scope.checkAreas = Object.keys(unique).map(function(u){return JSON.parse(u) });
        }
        function equalArea(){
            var ids = [];
            angular.forEach($scope.checkAreas,function(obj){
                ids.push(obj.id)
            });
            console.log('tree ids==',ids);

            angular.forEach($scope.trees,function(data){
                console.log('tree data==',data)
                if(ids.indexOf(data.id)  !== -1){
                    data.selected = true;
                    console.log('tree data==',data)
                }else{
                    data.selected = false
                }
                angular.forEach(data.data,function(dat){
                    if(ids.indexOf(dat.id)  !== -1){
                        dat.selected = true;
                    }else{
                        dat.selected = false
                    }
                    angular.forEach(dat.data,function(da){
                        if(ids.indexOf(da.id)  !== -1){
                            da.selected = true;
                        }else{
                            da.selected = false
                        }
                    });
                    if(dat.selected){
                        angular.forEach(dat.data,function(da){
                            da['selected'] = true;
                        })
                    }
                })
                if(data.selected){
                    angular.forEach(data.data,function(d){
                        d['selected'] = true;
                    })
                }

            });
        }

