        //时间判断
        function invalidTime(video){
            $scope.validTime = true;
            angular.forEach(video,function(obj){
                if(obj.endTime < obj.startTime){
                    $scope.validTime = false;
                    return;
                }
            });
        }

        //保存数据
        bindVideoCtrl.checkCloseDialog = function() {
            $scope.errorMessage = '';

            console.log('$scope.checkAreas==',$scope.checkAreas);
            video.videoId = parseInt($stateParams.videoId);
            video.areaId = [];
            //video = $scope.marketTimes.concat($scope.videoTimes);
            //invalidTime(video);
            invalidTime($scope.videoTimes);
            //时间判断
            if(!$scope.validTime){
                StarsUtils.alert('保存失败:结束时间必须大于开始时间');
            }
            else{
                angular.forEach($scope.videoTimes,function(obj,i){

                    obj.endTime = Date.parse(obj.endTime)/1000;
                    obj.startTime = Date.parse(obj.startTime)/1000;
                });

                //key
                video.time = $scope.videoTimes;
                //地域id
                angular.forEach($scope.checkAreas,function(data){
                    video.areaId.push(data.id);
                });

                console.log('save video111==========',video);
                //return;
                if( video.areaId.length > 0 && video.appKey.length > 0 && video.marketId.length > 0){
                    //return;
                    $scope.submitStatus = true;
                    console.log('save video222==========',video);
                    contentService.setName('marketRelation').saveItem(video,$scope).then(function(data) {
                        if(video.time.length == 0){
                            StarsUtils.alert('未添加时段！');
                        }

                        $state.go('site.oms.contents.video');
                        $scope.submitStatus = false;
                    }, function(error) {
                        $scope.submitStatus = false;
                        console.info('checkCloseDialog failed', error);
                        $scope.errorMessage = 'code ' + error.type + ':' + error.message;
                    });
                }else{
                    StarsUtils.alert('选项不可为空，如果全部屏蔽，请全选！')
                }


            }

        };
